import { useEffect, useState } from 'react';
import './App.css';

function App() {

  [commands, setCommands] = useState(null)

  useEffect( () => {

    fetch("http://localhost:5000/api/command/all")
    .then( res => setCommands(res.body))


  }, [])

  return (
    <div className="App">
      {commands ? commands.map(comanda => <p>{JSON.stringify(comanda)}</p>) : null}
    </div>
  );
}

export default App;
